import Schedule from "../JsModules/Schedule";
import "./componentStyles/editSchedule.css";

// what's in props?
// props.app : the app model responsible for creating, updating, and deleting scheduels
// contains:
// currentSchedule: the schedule currently being shown by the UI
// app.updateSchedule(id, schedule)
// updateEditor: gives ability to close display

function EditSchedule(props) {
  // store edits here until submit
  let edittedCourses = [];

  // temporary course outline
  let temporaryCourse = {
    originalCourseName: "",
    courseName: "",
    courseCode: "",
    sectionNumber: "",
    creditHours: "",
    meetFrequencies: "",
    meetTime: "",
    meetRoom: "",
    professor: "",
  };

  // helper function to determine if a temporaryCourse object exists for some course in props
  const hasBeenEdited = (courseName) => {
    edittedCourses.forEach((course) => {
      if (course.originalCourseName === courseName) {
        return true;
      }
    });
    return false;
  };
  const handleSubmit = () => {
    // close the menu
    props.updateEditor();
  };

  const handleChange = (e) => {
    // loop through courses, if the course matches with the one being edited, update that
    // grab the name of course being edited
    const originalCourseName = e.target.classList[0];

    // grab the new course edit
    const newCourseName = e.target.value;

    // NOTE: add className of the course name to all inputs: DONE
    // NOTE: need to identify which course attribute was edited, and update the Course object: DONE as ID
    // NOTE: afterwards, pressing done will update the schedule itself (locally and on the server)
    props.currentSchedule.courses.forEach((course) => {
      // grab the course being edited
      if (course.courseName === originalCourseName) {
        console.log("match", course.courseName);
        console.log("editted yet?", hasBeenEdited(originalCourseName));

        // create and push a new temporaryCourse if not yet edited
        if (!hasBeenEdited(originalCourseName)) {
          console.log("hasn't been edited");
          var newTempCourse = temporaryCourse;
          newTempCourse.originalCourseName = originalCourseName;
          edittedCourses.push(newTempCourse);
        }

        // apply edits
        edittedCourses.forEach((course) => {
          console.log(course.originalCourseName);
          if (course.originalCourseName === originalCourseName) {
          }
        });
      }
    });
  };

  return (
    <div className="editor-container">
      {props.currentSchedule ? (
        <div className="inputs-holder">
          <input
            className="header-input"
            type="text"
            defaultValue={props.currentSchedule.name}
            id="scheduleName"
          />
          <ul className="schedules-list">
            {props.currentSchedule.courses.map((course, index) => (
              <div className="course-edit-container" key={index}>
                <h3>{course.courseName}</h3>
                <div className="course-boxes">
                  <div className="box box-1">
                    <label htmlFor="">Course Name</label>
                    <input
                      id="courseName"
                      type="text"
                      defaultValue={course.courseName}
                      onChange={handleChange}
                      className={course.courseName}
                    />

                    <label htmlFor="">Course Code</label>
                    <input
                      type="text"
                      defaultValue={course.courseCode}
                      id="courseCode"
                      className={course.courseName}
                    />

                    <label htmlFor="">Section Number</label>
                    <input
                      type="text"
                      defaultValue={course.sectionNumber}
                      id="sectionNumber"
                      className={course.courseName}
                    />

                    <label htmlFor="">Credit Hours</label>
                    <input
                      type="text"
                      defaultValue={course.creditHours}
                      id="creditHours"
                      className={course.courseName}
                    />
                  </div>
                  <div className="box box-2">
                    <label htmlFor="">Meet Days</label>
                    <input
                      type="text"
                      defaultValue={course.meetFrequencies}
                      id="meetFrequencies"
                    />

                    <label htmlFor="">Meet Time</label>
                    <input
                      type="text"
                      defaultValue={course.meetTime}
                      id="meetTime"
                      className={course.courseName}
                    />

                    <label htmlFor="">Meet Room</label>
                    <input
                      type="text"
                      defaultValue={course.meetRoom}
                      id="meetRoom"
                      className={course.courseName}
                    />

                    <label htmlFor="">Professor</label>
                    <input
                      type="text"
                      defaultValue={course.professor}
                      id="professor"
                      className={course.courseName}
                    />
                  </div>
                </div>
                <span className="divider"></span>
              </div>
            ))}
          </ul>
          <div className="schedule-options">
            <button className="schedule-edit-btn">Add</button>
            <button onClick={handleSubmit} className="schedule-edit-btn">
              Done
            </button>
          </div>
        </div>
      ) : (
        <p>No Schedule Found.</p>
      )}
    </div>
  );
}

export default EditSchedule;
